        description:
          'Basic attacks <span data-game="lol" style="white-space:pre; position:relative;" data-tip="On-hit" class="glossary"><a href="/wiki/Attack_effects#On_Hitting" title="Attack effects"><img data-relevant="0" height="20" data-image-key="On-hit_icon.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" loading="lazy" alt="On-hit icon" data-image-name="On-hit icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/7/75/On-hit_icon.png/revision/latest/scale-to-width-down/20?cb=20201114055106" width="20" class="lazyload" decoding="async"></a> <a href="/wiki/Attack_effects#On_Hitting" title="Attack effects">on-hit</a></span> reduce <i>Alpha Strike\'s</i> <span style="white-space:nowrap"><a title="Cooldown" href="/wiki/Cooldown"><img data-src="https://static.wikia.nocookie.net/leagueoflegends/images/d/d5/Cooldown_icon.png/revision/latest/scale-to-width-down/15?cb=20220425052027" height="15" width="15" class="lazyload" data-relevant="0" alt="Cooldown icon" decoding="async" loading="lazy" data-image-name="Cooldown icon.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-image-key="Cooldown_icon.png"></a>&nbsp;<b>current</b> cooldown</span> by <span style="border-bottom:1px dotted gray;cursor:help;" title="Affected by ability haste" class="basic-tooltip">1 second</span>.',
